<script type="text/template" id="submit-dialog-template">
  <div id="submit-dialog">
    <div id="page-create-email">
      <div class="section">
        <div id="human-machine-header">
          <div class="section-header">What should be included in the submission?</div>
          <label>
            <input type="checkbox" id="human-checkbox" checked="checked" />
            A person will view this form submission; include <b>human-readable text</b>.
          </label>
          <br />
          <label>
            <input type="checkbox" id="machine-checkbox" checked="checked" />
            This submission will be automatically processed by Veslink; include <b>encoded data.</b>
          </label>
        </div>
        <br />
        <br />
        <label>Preview</label>
        <% if (isVoyageInstructions !== true) { %>
          <textarea id="preview" readonly="readonly" style="height: 350px"><%- body %></textarea>
        <% } else { %>
          <div id="preview" class="email-preview" style="height: 350px" onclick="selectAllElementText('preview')"><%= body %></div>
        <% } %>
      </div>
      <p id="create-email-voyinstructions-text" style="display: none">
        Copy this text into an email to send the form. When you are finished, click <b>Submit</b> to submit the form in IMOS. If you do not want to submit this form, click <b>Cancel</b>.
      </p>
      <div class="section button-container">
        <input type="button" id="create-email" value="Create Email..." />
      </div>
    </div>
    <div id="page-email-created" style="display: none;">
      <div class="section">
        <div class="section-header">Email Created</div>
        <p>
          You should now see a newly created email message incorporating the data from your form submission.<br />
          <br />
          <b>If no new email window has appeared</b>, you may complete the form submission manually by clicking the button below:
        </p>
      </div>
      <div class="section button-container">
        <input type="button" id="finish-manually" value="Complete the Form Submission Manually" />
      </div>
      <div class="section">
        <br />
        <p>
          <b>Otherwise</b>, you're finished here. Don't forget send the email!
        </p>
      </div>
      <div class="section button-container">
        <input type="button" class="close-dialog" value="Close" />
      </div>
    </div>
    <div id="page-manual-submission" style="display: none;">
      <div id="manual-submission-description" class="section">
        <div class="section-header">Manual Submission</div>
        <p>
          Sometimes Veslink is unable to automatically create the full email submission.
          <br />
          <span class="sub-text">
            For example, if the contents of the email body are
            beyond a certain size limit then Windows prevents Veslink from automatically inserting the large content into the email.
          </span>
        </p>
      </div>
      <div class="section">
        <p>
          <span class="step-instructions"><b>Step 1:</b> If no new email window has appeared, create the following email:<br /></span>
          <div class="instructions">
            <table>
              <tr>
                <td>To:</td>
                <td>
                  <input id="email-to"type="text" value="<%- to %>" data-auto-select="" readonly="readonly" />
                </td>
              </tr>
              <tr>
                <td>Cc:</td>
                <td>
                  <input id="email-cc" type="text" value="<%- cc %>" data-auto-select="" readonly="readonly" />
                </td>
              </tr>
              <tr>
                <td>Subject:</td>
                <td>
                  <input id="email-subject" type="text" value="<%- subject %>" data-auto-select="" readonly="readonly" />
                </td>
              </tr>
            </table>
          </div>
        </p>
        <p>
          <label>
            <span class="step-instructions"><b>Step 2:</b> Copy and paste the following text into your email's body:</span>
            <span id="vi-body-label" style="display:none;">Preview: </span>
            <% if (isVoyageInstructions !== true) { %>
              <textarea id="email-body" data-auto-select="" readonly="readonly" style="height: 350px"><%- body %></textarea>
            <% } else { %>
              <span class="submit-vi-instructions">Copy the form contents below and paste them into an email. When you are finished, click <b><%=submitButtonLabel%></b> to mark the form as Submitted in IMOS.</span>
              <br />
              <div id="email-body" class="email-preview" style="height: 350px" onclick="selectAllElementText('email-body')"><%= body %></div>
            <% } %>
          </label>
        </p>
      </div>
    </div>
  </div>

</script>
<script language="javascript" type="text/javascript">

    // Mirrors DBForm.SubmitAction
    FormPresenter.SubmitAction = {
        Submit: 'submit',
        Save: 'save',
        Approve: 'approve',
        Reject: 'reject'
    };

    var Model = {
        printToXML: false,
        enableRevisionHistory: false,
        takeSnapshotOnSubmission: false,
        isVoyageInstructions: false,
        viEmailListJson: "",
        formGuid: "00000000-0000-0000-0000-000000000000",
        requestUrl: "https://veslink.com/FormsAndVessels/DownloadFormGroup",
        enableVIPrettyPrint: false,
        sendViEmailOnSubmit:  false,
        showEmailDialogOnSubmit:  false,
        printWithBrowser:  false,
        approvalRequired: false,
        hasBunkerConsumptionListTransaction: false,
        statusText: "",
        sendAsPdfAttachment: false,
        showFormStatusOnPrint: false
    };
    var jsDateFormat = "dd/mm/yy";
    var portcallRedirect = false;
    var portcallRedirectUrl = "";
    var processingKeyDownEvent = false;
    var previousFormDate = null, previousFormPort = null;
    var revisionHistory = null;
    var formChanged = false;
    var VIEmailList = [];

    function initFormProperties() {

        for (var crewIdx = formCrews.length - 1; crewIdx >=0;  crewIdx--) {

            var first = formCrews[crewIdx].firstName;
            var last = formCrews[crewIdx].lastName;
            var key = formCrews[crewIdx].key;
            var desc = formCrews[crewIdx].desc;

            if(formValues.properties[key + 'FirstName'] !== undefined)
                first = formValues.properties[key + 'FirstName'];
            if(formValues.properties[key + 'LastName'] !== undefined)
                last = formValues.properties[key + 'LastName'];



            var newDiv = $('<div/>');
            newDiv.attr('id', key);
            newDiv.addClass('mastersName');
            newDiv.append($('<p/>').html(desc));
            newDiv.append($('<label/>').attr('for', key + "FirstName").html("First:"));
            newDiv.append($('<input type=\"text\"/>').attr('id', key + "FirstName").val(first).addClass('formCrewInput'));
            newDiv.append($('<label/>').attr('for', key + "LastName").html("Last:"));
            newDiv.append($('<input type=\"text\"/>').attr('id', key + "LastName").val(last).addClass('formCrewInput'));

            $('#formFooter').prepend(newDiv);
        }
    }

    function initFormTabs() {
        if (!allForms)
            return;

        var selectedId = getURLParameter("selectedForm");
        if (selectedId && allForms[selectedId]) {
            formValues = allForms[selectedId].values;
            formTemplateGuid = selectedId;
        }

        if (allForms[formTemplateGuid]) {
            // Reload these variables from allForms in case a saved version of the form is loaded
            form = allForms[formTemplateGuid].form;
            formCrews = allForms[formTemplateGuid].crews;
            formConfigs = allForms[formTemplateGuid].configs;
        }

        if (!savedForm) {
            $.each(allForms, function(guid, currentForm) {
                var url;
                if (selectedId)
                    url = window.location.href.replace(/selectedForm=(\w|-)+/, "selectedForm=" + guid);
                else
                    url = window.location.href + (location.search.length === 0 ? "?" : "&") + "selectedForm=" + guid;

                var tab = $("<div>").text(currentForm.form.title);

                tab.click(function() {
                    if (formTemplateGuid === guid)
                        return;

                    if (formChanged) {
                        var dialogOpts = {};
                        dialogOpts['title'] = 'Warning';
                        dialogOpts['buttons'] =
                        { "Yes":  function() { $(this).dialog("close"); window.location.replace(url); },
                            "No":   function() { $(this).dialog("close"); }
                        };
                        dialogOpts['open'] = function() { $('.ui-dialog').find('button').eq(1).focus();};
                        ShowDialog("You will lose any unsaved work if you change forms. Are you sure you want to continue?", dialogOpts);
                    }
                    else {
                        window.location.replace(url);
                    }
                });

                if (formTemplateGuid === guid) {
                    tab.addClass("currentTab");
                }

                $("#formTabs").append(tab);
            });
        }
    }

    function updateRevisionTable(){
        if(!Model.isVoyageInstructions || !Model.enableRevisionHistory)
            return;

        var revisionTable = _.template($("#revision-history-template").html());

        //if this is an unsubmitted form, formGuid won't be defined yet, so we need to get the other data for the controller
        var form = {
            companyCode: FormPresenter.companyCode,
            vesselCode: __vesselCode,
            formTemplateId: formTemplateGuid,
            formValues: getFormValues(false),
            action: FormPresenter.SubmitAction.Submit,
            voyageNo: __voyageNo
        };

        if (window.__portCallSeq) {
            form.portCallSeq = __portCallSeq;
        }

        var input = {
            formGuid : Model.formGuid,
            formTemplateGuid: formTemplateGuid,
            voyageNo: __voyageNo,
            vesselCode: __vesselCode,
            formJson: JSON.stringify(form),
            isReadonly: Form.displayMode === "readOnly"
        }

        $.ajax({
            url: "/VoyageInstructions/GetRevisionHistory",
            type: "POST",
            data: input,
            dataType: "json",
            success: function (result) {
                var revisionTableHtml = revisionTable(result);

                var initialRevisionHistory = revisionHistory === null;

                //used when preparing submission html
                revisionHistory = result;

                if(initialRevisionHistory){
                    var revisionNumberText = "<li id='revision-number-text'>Revision Number: <span class='status'>" + result.revisionCount + "</span></li>";
                    $("ul.status-text").append(revisionNumberText);
                }

                $("#revision-history").remove();
                $("#renderedVfml").append(revisionTableHtml);
            }
        });

    }

    function initVForm() {
        var options = {

        }

    function postData(url, data) {
        return new Promise(function (resolve) {
            function ajaxError() {
                vForm.showDialog('Unable to contact server, or authentication timeout. Please close the window and try again.');
                initButtons(); // re-enable buttons that were disabled during the operation
            }

            $.ajax({
                type: "POST",
                url: url,
                data: data,
                error: ajaxError,
                success: function (response) {
                    if (response)
                        resolve(response);
                    else
                        ajaxError();
                }
            });
        });
    }

    function giveApproval(approved, rejectReason, mailVessel) {
        var submission = {
            'companyCode': FormPresenter.companyCode,
            'vesselCode': __vesselCode,
            'formId': formId,
            'formTemplateId': formTemplateGuid,
            'action': approved ? FormPresenter.SubmitAction.Approve : FormPresenter.SubmitAction.Reject,
            'rejectReason': rejectReason
        };
        if (approved) {
            submission['formValues'] = getFormValues(false);
        }
        // try handling rejection in local IMOS if voyage instructions and IMOS can handle it
        if (Model.isVoyageInstructions) {
            if (!approved && window.external.OnVIFormReject) {
                window.external.OnVIFormReject();
                giveApproval_callback_success(approved, true, rejectReason, mailVessel, null);
                return false;
            }
        }

        $(".formButtons li *").attr('disabled', 'disabled');
        return postData('/FormApprove.ashx', { formJson : JSON.stringify(submission), action : submission.action })
            .then(function (response) { giveApproval_callback(approved, response, rejectReason, mailVessel); });
    }

    function getFormValues(shouldCompress) {

        var formValues = vForm.getFormValues(shouldCompress);

        //clear form properties
        formValues.properties = {};

        for(var crewIdx = 0; crewIdx < formCrews.length; crewIdx++)
        {
            var key = formCrews[crewIdx].key;
            formValues.properties[key + 'FirstName'] = $('#' + key + 'FirstName').val();
            formValues.properties[key + 'LastName'] = $('#' + key + 'LastName').val();
        }

        return formValues;
    }

    function giveApproval_callback(approved, response, rejectReason, mailVessel) {
        var rsp = $(response).find('rsp');
        var success = rsp.attr("stat") === 'ok';
        var errors;
        if (!success) {
            errors = $.map(rsp.children('err'),
                function(err) {
                    var msg = $(err).attr('msg');
                    return $('<div/>').text(msg).html(); // escape HTML
                });
        }
        giveApproval_callback_success(approved, success, rejectReason, mailVessel, errors);
    }

    function giveApproval_callback_success(approved, success, rejectReason, mailVessel, errors) {

        if (success) {
            // form will only be null in offline mode, where this function isn't used
        } else {
            vForm.showDialog('Form submission failed. ' + errors);

    function getEncodedDataBlock() {

        var submission = getOfflineFormMetadata();

        var zip = new JSZip("DEFLATE");
        if (zip.add("f", JSON.stringify(submission)) === null)
            return; // count on callback to display error dialog

        var encodedData = zip.generate().replace(/(.{72})/g, "$1\n");
        return "-----BEGIN VESLINK FORM DATA (" + Form.veslinkVersion + ")-----\n" + encodedData + "\n-----END VESLINK FORM DATA-----";
    }

    // Select all of the text in the HTML element with the id specified. Used
    // on the submit dialog.
    function selectAllElementText(containerid) {
        if (document.selection) {
            var range = document.body.createTextRange();
            range.moveToElementText(document.getElementById(containerid));
            range.select();
        } else if (window.getSelection) {
            var range = document.createRange();
            range.selectNode(document.getElementById(containerid));
            window.getSelection().removeAllRanges();
            window.getSelection().addRange(range);
        }

        // Automatically trigger a copy to clipboard. This is a crude way of
        // working around an apparent bug in IE (at least IE 10) that prevents
        // the user from using Ctrl-C to copy the selection made above.
        try {
            document.execCommand('copy');
        } catch(err) {
        }
    }

    function showManualSubmissionPage(hideDescription) {

    function getEmailSubject() {
        return 'Veslink Offline Form Submission: ' + form.title + ' - ' + Vessel.Name;

    function createEmail() {

        $("#page-create-email").hide();

        var urlLengthLimit = 2048;

        var subject = encodeURIComponent(getEmailSubject());
        var partialEmailUrl = 'mailto:' + encodeURIComponent(Form.replyAddress) + '?';
        if (Form.ccAddresses.length > 0) {
            partialEmailUrl += "cc=" + encodeURIComponent(Form.ccAddresses.join(";")) + '&';
        }

        partialEmailUrl += 'subject=' + subject;
        var fullEmailUrl = partialEmailUrl + '&body=' + encodeURIComponent(getSubmissionBody());

        var isOverLimit = fullEmailUrl.length > urlLengthLimit;
        var url = isOverLimit ? partialEmailUrl : fullEmailUrl;

        // Are we configured to NOT try to automatically create a new email?
        if (Config.dontInvokeEmailClient) {
            showManualSubmissionPage(true);
            return;
        }

        // Otherwise, attempt to open a new email.
        // Browsers on Windows launch mailto URLs using a syscall with a 2KB buffer
        // Some will throw an exception if that is exceeded, but others do not.
        try {
            window.location = url;

            if (isOverLimit) {
                showManualSubmissionPage(false);
            }
            else {
                showEmailCreatedPage();
            }
        }
        catch (e) {
            showManualSubmissionPage(false);
        }
    }

    function submitForm_callback(response) {
        var rsp = $(response).find('rsp');
        var success = rsp.attr('stat') === 'ok';

        if (success) {
            var submitted = rsp.children('submitted').text() === 'true';
            var action = rsp.children('action').text();

            // Raise an event to indicate success. This can be listened to from
            // the iframe's parent window, if needed.
            var formId = rsp.find("responseId").text();
            var hasValidationErrors = rsp.find("hasValidationErrors").text() === "true";

            var onSubmitSuccess = function () {
                $("body").trigger("form-submit-success", [formId, hasValidationErrors]);

                if (submitted && !Model.isVoyageInstructions && !FormPresenter.skipReloadAfterSubmit) {
                    window.location.reload();
                }
                else if (submitted && (Model.sendViEmailOnSubmit || action === "Save" || (Model.approvalRequired && !isReopened))) {
                    Model.formGuid = formId;
                    if (action === "Submit" && window.external.FormSubmitSuccess)
                        window.external.FormSubmitSuccess();
                    if (!Model.sendViEmailOnSubmit || action === "Save") {
                        closeBrowserWindow();
                    }
                }
            };

            if (action === "Submit" && Model.showEmailDialogOnSubmit && !hasValidationErrors) {
                showEmailDialog(formId, onSubmitSuccess);
            } else {
                onSubmitSuccess();
            }
        } else {
            var errors = $.map(rsp.children('err'), function (err) {
                var msg = $(err).attr('msg');
                return $('<div/>').text(msg).html(); // escape HTML
            });

            $("body").trigger("form-submit-error", [errors]);

            vForm.showDialog('Form submission failed. ' + errors);
            initButtons();
        }
    }

                var activities = vForm.getFormValues().fieldValues[field].activities;

    function initButtons() {
        // To simplify below logic, everything starts out hidden yet enabled
        $(".formButtons li > *").removeAttr('disabled');
        $(".formButtons > li, .formButtons .button-dropdown li > *").hide();

        if (typeof (onBehalfOf) !== "undefined" || FormPresenter.isOnboard) {
            // For Agent Portal and Onboard submissions, we limit functionality
            // to submitting new forms and editing unapproved forms.

            $(".printButtonContainer").show();
            if (formId == null) {
                $(".submitButtonContainer").show();
                $(".saveButtonContainer").show();

            } else if (FormPresenter.isDraft) {
                $(".submitButtonContainer").show();
                $(".saveButton").text("Update Draft");
                $(".saveButtonContainer").show();
                if (FormPresenter.isOnboard && !FormPresenter.isVesselSite) {
                    $(".deleteDraftButtonContainer").show();
                }
            } else if (FormPresenter.isOnboard && (Form.displayMode == "submitted" || (Form.displayMode == "approval" && !validatedWithErrors))) {
                // "approval" corresponds to "validated" form state, which, when onboard and the form is error-free, means the form has
                // been applied to the mini-schema and should be considered submitted.
                // Adjusting the logic here because the server-side logic to set displayMode is onboard-agnostic.
                if(FormPresenter.permissions == null || (FormPresenter.permissions != null && FormPresenter.permissions.resubmit)) {
                    $(".submitButton").text("Resubmit");
                    $(".submitButtonContainer").show();
                    if (!isReopened) {
                        $(".reopenButtonContainer").show();
                        $(".submitButton").attr('disabled', 'disabled');

                    }
                }
            } else if (Form.displayMode == "approval") {
                $(".saveButton").text("Save Changes");
                $(".saveButtonContainer").show();
            }
        } else {
            switch (Form.displayMode) {
                case "offline":
                    $(".submitButtonContainer, .formatButtonContainer").show();
                    if(isLocalDraftSupported())
                        $(".saveButtonContainer").show();
                    if (isExecCommandSaveAsSupported())
                        $(".openButtonContainer").show();

                    $(".saveOfflineFileButtonContainer").show();
                    break;
                case "approval":
                    $(".acceptButtonContainer, .rejectButtonContainer, .printButtonContainer").show();
                    break;
                case "submitted":
                    $(".submitButtonContainer, .printButtonContainer").show();
                    if (FormPresenter.standalone)
                        $(".rejectButtonContainer").show();

                    if (formId == null || FormPresenter.isDraft) {
                        $(".saveButtonContainer").show();
                    }
                    break;
                case "readOnly":
                    if (!FormPresenter.isRejected && !Model.isVoyageInstructions && !FormPresenter.isDraft && Model.statusText !== "Processing") {
                        $(".rejectButtonContainer").show();
                    }
                    if (formId && !FormPresenter.isOnboard && !FormPresenter.isAgentForm && FormPresenter.isRejected && FormPresenter.permissions.delete) {
                        $(".deleteRejectedFormButtonContainer").show();
                    }
                    $(".printButtonContainer").show();
                    break;
                case "xmlTest":
                    $(".showXMLButtonContainer").show();
                    break;
            }
        }

        if (formId && !FormPresenter.isVesselSite && !FormPresenter.isRejected) {
            $(".attachmentButtonContainer").show();
        }

        // We can always print if we have an RDL report definition. If that isn't the case, the backup
        // strategy is to use wkhtmltopdf to generate a PDF from rendered HTML of the submitted form.
        var canRenderPdfFromHtml = !(newResponse || vForm.hasChanges || Form.displayMode == "offline");
        if (!Form.hasReportDefn && !canRenderPdfFromHtml) {
            if (vForm.hasChanges)
                $(".printButton").attr('disabled', 'disabled');
            else
                $(".printButtonContainer").hide();
        }

        if (Model.printToXML)
            $(".showXMLButtonContainer").show();

        $(".formButtons li *").unbind('click'); // .click() is no longer idempotent in JQuery 1.4
        $('.formatButton').click(formatButton_click);
        $('.acceptButton').click(approveButton_click);
        $('.rejectButton').click(rejectButton_click);
        $('.submitButton').click(function() { submitButton_click(false); });
        $('.reopenButton').click(reopenButton_click);
        $('.saveButton').click(saveButton_click);
        $('.saveOfflineFileButton').click(saveOfflineFileButton_click);
        $('.openButton').click(openButton_click);
        $('.printButton').click(printButton_click);
        $('.printPdf, .printExcel, .printWord').click(printItemClick);
        $('.showXMLButton').click(showXMLButton_click);
        $('.attachmentButton').click(attachmentButton_click);
        $('.deleteDraftButton').click(deleteDraftButton_click);
        $('.deleteRejectedFormButton').click(deleteRejectedFormButton_click);

        if (FormPresenter.permissions != null && !FormPresenter.permissions.approve) {
            $('.acceptButton, .rejectButton').attr('disabled', 'disabled');
        }

        if (FormPresenter.permissions != null && FormPresenter.permissions.approve && formSubmitted && !FormPresenter.isOnboard && !FormPresenter.isAgentForm) {
            $(".rejectButtonContainer").show();
        }

        if (formSubmitted && !isReopened) {
            $('.saveButton, .submitButton, .formCrewInput').attr('disabled', 'disabled');

            if (FormPresenter.permissions != null && FormPresenter.permissions.resubmit) {
                $('.submitButton').html('Resubmit');
                $('.reopenButtonContainer').show();
            }

            $('.delCol').hide();
            $('#AddNewAttachLink, #ConfirmAttachLink').hide();
        } else {
            $('.delCol').show();
            $('#AddNewAttachLink').show();
            $('#ConfirmAttachLink').hide();
        }

        if(FormPresenter.voyageClosed){
            var reopenButton = $(".reopenButton");
            reopenButton.attr('disabled','disabled');
            addTooltip(reopenButton.parent(),"Voyage is Closed -- form cannot be reopened.");
        }

        if(!formSubmitted && !(Form.isVoyageForm || Form.isOfflineForm || Form.isAgentForm) && !FormPresenter.voyageLegFirm){
            var submitButton = $(".submitButton");
            submitButton.attr('disabled','disabled');
            addTooltip(submitButton.parent(),"Port Status in IMOS must be set to \"Firm\" in order to submit forms.");
        }
    }

    function handleKeyDownEvent(event) {
        if(event.keyCode == 8) { //BACKSPACE
            if(document.activeElement.nodeName != 'INPUT' && document.activeElement.nodeName != 'TEXTAREA')
            {
                //AJAX dialog is asynchronous, which won't halt the event from happening,
                //so we just stop the event and proceed ourselves
                event.stopPropagation(); //prevent the event from bubbling up the DOM tree, so parent handler won't be called
                event.preventDefault(); //prevent default action

                if(!processingKeyDownEvent) {
                    processingKeyDownEvent = true;

                    var dialogOpts = {};
                    dialogOpts['title'] = 'Leaving Current Page';
                    dialogOpts['buttons'] =
                    { "Yes":  function() { processingKeyDownEvent = false; $(this).dialog("destroy"); history.back(); },
                        "No":   function() { processingKeyDownEvent = false; $(this).dialog("destroy"); }
                    };
                    dialogOpts['close'] = function() { processingKeyDownEvent = false; };
                    dialogOpts['closeOnEscape'] = false;
                    dialogOpts['open'] = function() { $('.ui-dialog').find('button').eq(1).focus();};
                    ShowDialog("You will lose any unsaved work if you leave this form. Are you sure you want to leave?", dialogOpts);
                }
            }
        }
    }

    function showErrors(errorXml) {
        // show time when validation ran, if available
        if (!FormPresenter.printPreview) {
            try {
                var parser = new DOMParser();
                var doc = parser.parseFromString(errorXml, "application/xml");
                var timeNode = doc.querySelector("TimeGmt");

                if (timeNode && timeNode.textContent) {
                    var validationDate = new Date(timeNode.textContent);
                    $("#validationTimeSpan").text("Validation ran at " + validationDate.toLocaleString());
                    $("#validationTimeBox").toggle(true);
                }
            } catch (err) { } // in case old browsers don't handle some of the date or XML stuff
        }

        showMessages("Error", "#errorBox", $(errorXml).children('Error'));
        showMessages("Warning", "#warningBox", $(errorXml).children('Warning'));
    }

    function showCharterers(chartererList) {
        var buttons = {};
        buttons["Export"] = function () {
            var forCharterers = [];
            var otherCheckboxes = document.getElementsByName("chartererCheckbox");
            for (var iter = 0; iter < otherCheckboxes.length; iter++) {
                var checkbox = otherCheckboxes[iter];
                if (checkbox.checked === true) {
                    forCharterers.push(checkbox.id);
                }

            }
            $(this).dialog("close");
            showXMLOfflineWithCharterers(forCharterers);
        };
        buttons["Cancel"] = function () { $(this).dialog("close"); };

        var el = document.createElement("div");
        $(el).css({ "overflow-y": "auto", "font-size": "14px"});

        var header = document.createElement("label");
        $(header).addClass("section-header");
        header.innerText = "Select charterer(s) for which you want to export port activities:"

        el.appendChild(header);
        el.appendChild(document.createElement("br"));
        el.appendChild(document.createElement("br"));

        var charterer = "Select All";
        var element = document.createElement("div");
        var label = document.createElement("label");
        var checkbox = document.createElement("input");

        checkbox.type = "checkbox";
        checkbox.id = "selectAllCharterersCheckbox";
        checkbox.onchange = function() {
            var selectAllCheckbox = document.getElementById("selectAllCharterersCheckbox");
            var otherCheckboxes = document.getElementsByName("chartererCheckbox");
            for (var iter = 0; iter < otherCheckboxes.length; iter++) {
                otherCheckboxes[iter].checked = selectAllCheckbox.checked;
            }
        };

        $(label).css({ "font-size": "12px" })
        label.htmlFor = checkbox.id;
        label.innerText = charterer;

        element.appendChild(checkbox);
        element.appendChild(label);

        el.appendChild(element);
        el.appendChild(document.createElement("br"));

        for (var i = 0; i < chartererList.length; i++) {
            var charterer = chartererList[i];

            var element = document.createElement("div");
            var label = document.createElement("label");
            var checkbox = document.createElement("input");

            checkbox.type = "checkbox";
            checkbox.name = 'chartererCheckbox';
            checkbox.id = charterer;
            checkbox.onchange = function() {
                document.getElementById("selectAllCharterersCheckbox").checked = false;
            };

            $(label).css({ "font-size": "12px" })
            label.htmlFor = checkbox.id;
            label.innerText = charterer;

            element.appendChild(checkbox);
            element.appendChild(label);

            el.appendChild(element);
            el.appendChild(document.createElement("br"));

        }
        vForm.showDialog(el, { title: "Select Charterer(s)", buttons: buttons }, true);
    }

    function showMessages(typeOfMsg, containerSelector, msgList) {
        $(containerSelector + " .errorsText").html('');
        if (msgList.length == 1) {
            $(containerSelector + ' .errorsLabel').text('Submission ' + typeOfMsg + ":");
            $(containerSelector + ' .errorsText').text(msgList.find('Message').text());
        } else {
            $(containerSelector + ' .errorsLabel').text('Submission ' + typeOfMsg + "s:");
            var list = $('<ul>').appendTo(containerSelector + ' .errorsText');
            msgList.each(function(i, err) {
                var li = $('<li>').appendTo(list);
                li.text($(err).find('Message').text());
            });
        }

        $(containerSelector).toggle(msgList.length > 0);

    }

    function getPageSource(){
        var XHR;
        if (window.ActiveXObject || "ActiveXObject" in window) {
            XHR = new ActiveXObject("Msxml2.XMLHTTP");
        } else {
            XHR = new XMLHttpRequest;
        }

        XHR.open('GET', window.location.href, false );
        XHR.send('');
        return processPagesource(XHR.responseText);
    }

    function isLocalDraftSupported() {
        return typeof localStorage !== "undefined";
    }

    function isExecCommandSaveAsSupported() {
        // Offline form draft saving depends on document.execCommand("saveas"),
        // check if that is supported using the obscure document.queryCommandSupported.
        // Have in try/catch to be safe, in case browser doesn't support queryCommandSupported (early firefox)
        try {
            return document.queryCommandSupported("saveas");
        } catch(e) {
            return false;
        }
    }

    // the advantage of this approach is that it includes a windows "Save As" dialog, which alows the user to choose location/name when saving
    // but it is only supported by IE
    function saveDraftAsFileWithExecCommand() {
        var pagesource = getPageSource();
        var pageUrl = window.location.pathname;
        var filename = unescape(pageUrl.substring(pageUrl.lastIndexOf('/')+1));

        var w = window.open(document.URL);
        w.document.open("text/html","replace");
        w.document.write(pagesource);
        w.document.close();
        w.document.execCommand("saveas", false, filename);
        w.close();
    }

    // manually embed the updated formValues and templateId
    function processPagesource(pagesource) {
        pagesource = pagesource.replace(/(\/\* May be overwritten when saving \*\/ var formValues).*(;\n)/, "$1 = " + JSON.stringify(getFormValues()) + "$2");
        pagesource = pagesource.replace(/(\/\* May be overwritten when saving \*\/ var formTemplateGuid).*(;\n)/, "$1 = '" + formTemplateGuid + "'$2");
        pagesource = pagesource.replace(/(\/\* May be overwritten when saving \*\/ var savedForm).*(;\n)/, "$1 = true$2");

        return pagesource;
    }

    function saveDraftAsFile(pagesource) {
        var a = window.document.createElement('a');

        a.href = window.URL.createObjectURL(new Blob([pagesource], {type: 'text/plain'}));
        a.download = allForms[formTemplateGuid].form.title + " Draft.html";

        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
    }

    function saveDraftOffline(saveAsFile) {
        var error;

        //when a field is hidden, the html control is cleared, but this doesn't automatically update form values.
        //Want to make sure the values saved in the draft are consistent with the form state
        vForm.updateFormValues();

        //drafts can be saved as an entirely separate html file, but it is not supported by all browsers.
        if(saveAsFile && isExecCommandSaveAsSupported()) {
            try {
                saveDraftAsFileWithExecCommand();
                return true;
            } catch (e) {
                error = e.message;
            }

        } else if (saveAsFile) {
            //initial pagesource is defined in ViewReportOffline.cshtml, so this function should only work for offline forms.
            if(initialPagesource && initialPagesource !== null) {
                saveDraftAsFile(processPagesource(initialPagesource));
                return true;
            } else {
                error = "Unable to retrieve form source.";
            }
        }
        else if (isLocalDraftSupported()) {
            var result = saveLocalFormValues(true);
            if(result.success){
                updateLocalStorageLinks();
                vForm.showDialog("" , { title: "Draft Saved Successfully" ,buttons: { Okay : function() { $(this).dialog("close"); }}});
                formChanged = false;
                return true;
            }
            error = result.message;

        } else {
            error = "Sorry, your browser does not support saving offline forms.";
        }

        vForm.showDialog(error , { title: "Error Saving Draft" ,buttons: { Okay : function() { $(this).dialog("close"); }}});
        return false;
    }

    function getLocalStorageKey(guid) {
        return (guid || formTemplateGuid) + " " + __vesselCode;
    }
    // checking two keys for backwards compatibility
    // getLocalStorage will check for formTemplateGuid and vesselCode while formTemplateGuid only checks for formTemplateGuid
    // passing guid is optional as a fall back. Used in forms-robinput that way.
    function getLocalStorageDraft(guid) {
        if (getLocalStorageKey(guid) in localStorage)
            return localStorage.getItem(getLocalStorageKey(guid));
        else
            return localStorage.getItem(guid || formTemplateGuid);
    }

    function updateLocalStorageLinks() {
       $("#localStorageLinks").remove();
        if (isLocalDraftSupported() && getLocalStorageDraft() !== null)
            $("#formBody .header").append("<div id='localStorageLinks'></div>");
        else
            return;

        var data = JSON.parse(getLocalStorageDraft());

        if(data.draft){
            $("#localStorageLinks").append(
                "<div id='draftLink'>" +
                    "<span>Last Draft Saved: </span>" +
                    "<a>" + data.draft.date  + "</a>" +
                "</div>");

            $('#draftLink a').click(loadLocalDraft);
        }

        if(data.submission){
            $("#localStorageLinks").append(
                "<div id='prevSubmissionLink'>" +
                    "<span>Last Submitted: </span>" +
                    "<a>" + data.submission.date  + "</a>" +
                "</div>");

            $('#prevSubmissionLink a').click(loadPreviousSubmission);
        }
    }

    function isDraftExpired(draft) {
        if (draft && draft.date) {
            var now = new Date();
            var date = new Date(draft.date);
            date.setDate(date.getDate() + 30);

            return date < now;
        }
        return false;
    }

    function cleanLocalStorage() {
        var keys = _.keys(localStorage);
        for (var i = 0; i < keys.length; i++) {
            var data;
            try{
                data = JSON.parse(localStorage.getItem(keys[i]));
            } catch(e){
                //ignore if it is invalid json
                continue;
            }

            if (isDraftExpired(data.draft))
                delete data.draft;
            if (isDraftExpired(data.submission))
                delete data.submission;
            localStorage.setItem(keys[i], JSON.stringify(data));
        }
    }

    function loadDraftData() {
        sessionStorage.setItem("initValuesFromLocalDraft", "true");
        window.location.reload();
    }

    function loadLocalDraft() {
        if (formChanged) {
            var dialogOpts = {};
            dialogOpts['title'] = 'Warning';
            dialogOpts['buttons'] =
            { "Yes": function() {
                $(this).dialog("close");
                loadDraftData();
            },
                "No": function() {
                    $(this).dialog("close");
                }
            };
            dialogOpts['open'] = function() { $('.ui-dialog').find('button').eq(1).focus();};
            ShowDialog("You will lose any unsaved work if you change forms. Are you sure you want to continue?", dialogOpts);
        } else {
            loadDraftData();
        }
    }

    function loadPreviousSubmission() {
        var w = window.open(document.URL, "_blank");

        if (typeof sessionStorage != "undefined") {
            w.sessionStorage.setItem("initValuesFromPreviousSubmission", "true");
        }
    }

    function saveLocalFormValues(isDraft, alreadyCleanedLocalStorage) {
        try {
            var date = new Date();
            var data = {
                "formValues": getFormValues(true),
                "date": date.toLocaleString()
            };

            var templateData = {};
            var storageData = getLocalStorageDraft();
            if (storageData) {
                templateData = JSON.parse(storageData);
            }
            templateData[isDraft ? "draft" : "submission"] = data;
            localStorage.setItem(getLocalStorageKey(), JSON.stringify(templateData));
        } catch (e) {
            //if localStorage is full, clean out all entries older than 30 days, and retry.
            if (e.code === 22 && !alreadyCleanedLocalStorage) {
                cleanLocalStorage();
                return saveLocalFormValues(isDraft, true);
            } else {
                return {
                    success: false,
                    message: e.message
                };
            }
        }

        return {
            success: true
        };
    }

    function initOfflineFormHeader() {
        if(form.usesCustomHeader)
        {
            $('div .header .left *').remove();
            $('div .header').css("border", "none");
        }
        else
        {
            $('.formTitle').html(form.title);
            $('.formDescription').html(form.description);
        }
        updateLocalStorageLinks();
    }

    function setInitialformValues() {
        //(Chrome) opening formatted-for-print version in new tab. window.opener violates SOP on chrome (for local files), so use sessionStorage instead
        if(typeof sessionStorage !== "undefined" && sessionStorage.getItem("generatingPrintPreview") === "true" && sessionStorage.getItem("formValues") !== null){
            formValues = JSON.parse(sessionStorage.getItem("formValues"));
            FormPresenter.printPreview = true;
            //set this, because we always want the activity templates dropdown to be visible in SoF forms.
            FormPresenter.showActivityTemplates = true;
            //so that fields are set from formValues, rather than default or valueExpressions
            newResponse = false;
        //(IE) opening formatted-for-print version in new tab. sessionStorage is broken on IE (for local files), so use window.opener instead
        } else if (typeof sessionStorage === "undefined" && window.opener && window.opener.generatingPrintPreview) {
            formValues = window.opener.getFormValues();
            FormPresenter.printPreview = true;
            FormPresenter.showActivityTemplates = true;
            newResponse = false;
        //(Chrome) Reloading the page with form values from the draft in localStorage
        } else if (typeof sessionStorage !== "undefined" && sessionStorage.getItem("initValuesFromLocalDraft") === "true"
            && isLocalDraftSupported() && getLocalStorageDraft() !== null) {
            formValues = JSON.parse(getLocalStorageDraft()).draft.formValues;
            FormPresenter.showActivityTemplates = true;
            newResponse = false;
            sessionStorage.removeItem("initValuesFromLocalDraft");
        //(Chrome) Reloading the page with form values from the previous submission in localStorage
        } else if (typeof sessionStorage !== "undefined" && sessionStorage.getItem("initValuesFromPreviousSubmission") === "true"
            && isLocalDraftSupported() && getLocalStorageDraft() !== null) {
            formValues = JSON.parse(getLocalStorageDraft()).submission.formValues;
            newResponse = false;
            FormPresenter.showActivityTemplates = true;
            sessionStorage.removeItem("initValuesFromPreviousSubmission");
        } else {
            FormPresenter.showActivityTemplates = false;
            FormPresenter.printPreview = false;
            generatingPrintPreview = false;
        }
    }

    $(document).ready(function () {
        $("#formBody").removeClass("loading");
        if (Form.displayMode == 'offline') {
            $("#jsDisabledMsg").hide();
            $(".innerbox").show();

            initFormTabs();
            initOfflineFormHeader();
        }

        if (Model.isVoyageInstructions) {
            if (window.external && window.external.GetDefaultEmailList)
                VIEmailList = JSON.parse(window.external.GetDefaultEmailList());
            else if (Model.viEmailListJson)
                VIEmailList = JSON.parse(Model.viEmailListJson);
        }

        setInitialformValues();

        initFormProperties();
        initVForm();

        if (FormPresenter.allowSubmitDraft && !formSubmitted)
            $(".submitButton").text('Submit Final');
        initButtons();

        if (isReopened === true) {
            $('.submitButton').html('Resubmit');
            reopenButton_click();
        }

        showErrors($('#validationErrors').text());

        $(document).keydown(handleKeyDownEvent);

        
        // Focus the first available input in order to work around
        // the IE bug described here: http://bugs.jquery.com/ticket/12319
        // This affects all IE versions from IE7 to the current IE11
        $("input").filter(":focusable").first().focus();

        if (FormPresenter.printPreview === true) {
            vForm.formatForPrint();
            if (!Model.showFormStatusOnPrint) {
                $(".form-status-text").remove();
            }
            $(".formButtons, #formTabs, #warningBox, #errorBox, #localStorageLinks, #validationTimeBox").remove();
        }

        if (window.opener && window.opener.openingBrowserPrint){
            $("#formPdfFooter").show();
            window.print();
        }

    });
</script>
